// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./IAccounts.sol";
import "./IBurnableToken.sol";

// TODO: add check for zero address in relevant blocks

contract Exchange is AccessControlEnumerable {

  IAccounts accountsContract;

  address public treasury; // [termux/terminal]
  address internalReserveTokenAddress;
  address externalReserveTokenAddress;
  address[] tokenAddresses;

  bool haltCashIns;
  bool haltCashOuts;

  uint256 public minReserveTradeAmount;
  uint256 public tradeFeePercentMultiplier;
  uint256 public tradeFeePercentDivider;
  uint256 public cashInCommissionPercentMultiplier;
  uint256 public cashInCommissionPercentDivider;
  uint256 public cashOutCommissionPercentMultiplier;
  uint256 public cashOutCommissionPercentDivider;

  // send an amount for 60 txs to every new token holder
  // - top-up holder's balance when its below an amount 
  //   that will can cater for only 2 txs
  // The GOOD NEWS is; you'll have to perform a transaction with 
  // our token for our gas facilitator logic to be able to give 
  // out these free coins, which gives us some treasury collections 
  // and the amount of coins given is also insignificant to be used 
  // as a source of free money
  uint256 public minNativeThreshold;
  uint256 public maxNativeThreshold;
  bool public giveGas;

  // e.g.: if rate is 0.0014, the multiplier is 14, divider is 10000
  // e.g.: if rate is 10.05, the multiplier is 1005, divider is 100
  // stable to reserve === multiplier / divider === SIKA/KUSD
  // reserve to stable === divider / multiplier === KUSD/SIKA
  struct RateStruct {
    uint256 multiplier;
    uint256 divider;
    uint256 lastUpdated;
    bool activated;
  }
  // mappings are initialized automatically hence all possible keys already exists
  mapping(address => RateStruct) public rates; // token => Rate
  // each token is paired with internal reserve token, 
  // hence satisfying external reserve token

  // no `activated` variable since it already exists in 
  // RateStruct to prevent token from being traded in exchange
  struct StableTokenStruct {
    uint256 minTradeAmount; // IMPORTANT: must be set above 0

    uint256 minTariffAmount;
    uint256 maxTariffAmount;
    uint256 minTariff;
    uint256 maxTariff;
    uint256 tariffPercentMultiplier;
    uint256 tariffPercentDivider;

    uint256 totalCommissions;
    uint256 totalCashIns;
    uint256 totalCashOuts;
  }
  // mappings are initialized automatically hence all possible keys already exists
  mapping(address => StableTokenStruct) stableTokens; // stableToken => StableTokenOptions

  // Create a new role identifier for the role
  bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

  // there can be multiple external stablecoins (not developed by us)
  // in the treasury or reserve but there must be only one primary 
  // stablecoin set in the exchange at any given time
  IERC20 externalReserveToken; // USDC or USDT or CNHC

  // as at now there can only one internal stablecoin which
  // in the rare case of changing this currency from say 
  // USD to RMB stablecoin then it'll just be a matter of
  // setting an exchange rate
  IBurnableToken internalReserveToken; // KUSD (or in the future KRMB or in the far future KDSK)

  modifier onlyAgent {
    require(accountsContract.isAgent(msg.sender), "You are not an agent.");
    _;
  }

  constructor() {
    _setupRole(ADMIN_ROLE, msg.sender);
    treasury = msg.sender;
  }

  function setAccountsContract(address accountsAddress) external onlyRole(ADMIN_ROLE) {
    accountsContract = IAccounts(accountsAddress);
  }

  // applies to `convert` only
  function setTradeFeePercent(
    uint256 _multiplier, uint256 _divider
  ) external onlyRole(ADMIN_ROLE) {
    tradeFeePercentMultiplier = _multiplier;
    tradeFeePercentDivider = _divider;
  }

  // minTariffAmount = 50gh (all amount smaller than it must be charged the `minTariff`)
  // maxTariffAmount = 2000gh (all amounts larger than it must be charged the `maxTariff`)
  // minTariff = 0.5gh
  // maxTariff = 10gh
  // tariffPercent = 0.5%
  // - tariffPercentMultiplier = 2
  // - tariffPercentDivider = 400
  function setStableTokenOptions(
    address stableTokenAddress, 

    uint256 _minTradeAmount, // Buy, Sell, Cash In, Cash Out

    uint256 _minTariffAmount, 
    uint256 _maxTariffAmount, 
    uint256 _minTariff, 
    uint256 _maxTariff, 
    uint256 _tariffPercentMultiplier, 
    uint256 _tariffPercentDivider
  ) external onlyRole(ADMIN_ROLE) {
    StableTokenStruct storage stableToken = stableTokens[stableTokenAddress];

    stableToken.minTradeAmount = _minTradeAmount;

    stableToken.minTariffAmount = _minTariffAmount;
    stableToken.maxTariffAmount = _maxTariffAmount;
    stableToken.minTariff = _minTariff;
    stableToken.maxTariff = _maxTariff;
    stableToken.tariffPercentMultiplier = _tariffPercentMultiplier;
    stableToken.tariffPercentDivider = _tariffPercentDivider;
  }

  function getStableTokenOptions(
    address stableTokenAddress
  ) external view returns (StableTokenStruct memory) {
    return stableTokens[stableTokenAddress];
  }

  function setReserveOptions(
    address _internalReserveTokenAddress, 
    address _externalReserveTokenAddress, 
    uint256 _minReserveTradeAmount
  ) external onlyRole(ADMIN_ROLE) {
    internalReserveTokenAddress = _internalReserveTokenAddress;
    externalReserveTokenAddress = _externalReserveTokenAddress;
    minReserveTradeAmount = _minReserveTradeAmount;

    internalReserveToken = IBurnableToken(internalReserveTokenAddress);
    externalReserveToken = IERC20(externalReserveTokenAddress);
  }

  function setGasFacilitationOptions(
    bool _giveGas,
    uint256 _minNativeThreshold,
    uint256 _maxNativeThreshold
  ) external onlyRole(ADMIN_ROLE) {
    giveGas = _giveGas;
    minNativeThreshold = _minNativeThreshold;
    maxNativeThreshold = _maxNativeThreshold;
  }

  function toggleGasFacilitation() external onlyRole(ADMIN_ROLE) {
    giveGas = !giveGas;
  }

  // agent gets 0.5% commission on cash-ins and 0.4% commission on cash-outs
  function setAgentCommissions(
    uint256 _cashInCommissionPercentMultiplier, 
    uint256 _cashInCommissionPercentDivider, 

    uint256 _cashOutCommissionPercentMultiplier, 
    uint256 _cashOutCommissionPercentDivider
  ) external onlyRole(ADMIN_ROLE) {
    cashInCommissionPercentMultiplier = _cashInCommissionPercentMultiplier;
    cashInCommissionPercentDivider = _cashInCommissionPercentDivider;

    cashOutCommissionPercentMultiplier = _cashOutCommissionPercentMultiplier;
    cashOutCommissionPercentDivider = _cashOutCommissionPercentDivider;
  }

  // TODO: the front-end app should only allow calling this method on Saturdays

  function claimCommissions(address stableTokenAddress) external onlyAgent {
    IBurnableToken stableToken = IBurnableToken(stableTokenAddress);
    IAccounts.AccountStruct memory agent = accountsContract.getAccount(msg.sender);
    require(agent.commissions > 0, "You have no commissions to claim");
    accountsContract.updateCommissions(msg.sender, 0); // to prevent re-entrancy
    // IMPORTANT: contract must be given enough working capital for unclaimed commissions
    require(
      stableToken.transfer(msg.sender, agent.commissions), 
      "Failed to transfer commissions"
    );
    stableTokens[stableTokenAddress].totalCommissions += agent.commissions;
  }

  function cashRampOptions(
    bool _haltCashIns, 
    bool _haltCashOuts
  ) external onlyRole(ADMIN_ROLE) {
    haltCashIns = _haltCashIns;
    haltCashOuts = _haltCashOuts;
  }

  // agents allowances will be set to maximum for ramps to function easily
  function cashIn(
    address stableTokenAddress, 
    address client, 
    uint256 amount
  ) external onlyAgent {
    require(
      haltCashIns == false,
      "Cash-ins have been halted"
    );

    require(
      amount >= stableTokens[stableTokenAddress].minTradeAmount, 
      "Below minimum amount for cash-ins"
    );

    // CASH-IN... Client buys token with fiat:
    // balance checks happens in token itself hence no need to recheck them here
    IBurnableToken stableToken = IBurnableToken(stableTokenAddress);
    stableToken.transferFrom(msg.sender, client, amount);
    accountsContract.updateCommissions(msg.sender, (amount * cashInCommissionPercentMultiplier) / cashInCommissionPercentDivider);
    StableTokenStruct storage stableTokenOpts = stableTokens[stableTokenAddress];
    stableTokenOpts.totalCashIns += amount;
  }

  // TODO: will need to check accounts' balances at front-end before assignment
  function cashOut(
    address stableTokenAddress, 
    address agent, 
    uint256 amount
  ) external {
    require(
      haltCashOuts == false,
      "Cash-outs have been halted"
    );

    require(
      accountsContract.isAgent(agent), 
      "Address submitted isn't an agent. Try a different agent."
    );
    require(
      amount >= stableTokens[stableTokenAddress].minTradeAmount, 
      "Below minimum amount for cash-outs"
    );

    StableTokenStruct storage stableTokenOpts = stableTokens[stableTokenAddress];

    // cash-ins & outs are NOT free: a percentage paid as commissions to agents
    // min: N/A,     max: 50gh,   charge: 0.25gh
    // min: >50gh,   max: 1000gh, charge: 0.5%
    // min: >1000gh, max: N/A,    charge: 5gh
    uint256 fee;
    if (amount > stableTokenOpts.minTariffAmount && 
        amount <= stableTokenOpts.maxTariffAmount) {
      // expression to arrive at 0.5%
      fee = (amount * stableTokenOpts.tariffPercentMultiplier) / stableTokenOpts.tariffPercentDivider;
    } else if (amount <= stableTokenOpts.minTariffAmount) {
      fee = stableTokenOpts.minTariff;
    } else if (amount > stableTokenOpts.maxTariffAmount) {
      fee = stableTokenOpts.maxTariff;
    }

    // CASH-OUT... Client sells token for fiat:
    // balance checks happens in token itself hence no need to recheck them here
    IBurnableToken stableToken = IBurnableToken(stableTokenAddress);
    require(
      stableToken.balanceOf(msg.sender) >= (amount + fee), 
      "Insufficient balance from which to deduct the cash-out fee"
    );
    stableToken.transferFrom(msg.sender, treasury, fee);
    stableToken.transferFrom(msg.sender, agent, amount);
    accountsContract.updateCommissions(agent, (amount * cashOutCommissionPercentMultiplier) / cashOutCommissionPercentDivider);
    stableTokenOpts.totalCashOuts += amount;
  }

  // not applicable to KUSD/USDC pair as that is 1:1 pegged
  function upsertRate(
    address tokenAddress, 
    uint256 tokenToReserveMultiplier, 
    uint256 tokenToReserveDivider
  ) external onlyRole(ADMIN_ROLE) {
    require(tokenAddress != internalReserveTokenAddress, "Not applicable");
    if (rates[tokenAddress].lastUpdated == 0) {
      tokenAddresses.push(tokenAddress);
    }
    rates[tokenAddress] = RateStruct(
      tokenToReserveMultiplier, 
      tokenToReserveDivider, 
      block.timestamp, 
      true
    );
  }

  function getRate(
    address tokenAddress
  ) external view returns (RateStruct memory) {
    return rates[tokenAddress];
  }

  function toggleRateActivated(address tokenAddress) external onlyRole(ADMIN_ROLE) {
    rates[tokenAddress].activated = !rates[tokenAddress].activated;
  }

  function convert(
    address fromTokenAddress, address toTokenAddress, uint256 amount
  ) external {
    require(fromTokenAddress != toTokenAddress, "You cannot convert a token to its self");

    // TODO: find token address is a reserve and which one isn't

    RateStruct memory rate;

    if (toTokenAddress == internalReserveTokenAddress || 
        toTokenAddress == externalReserveTokenAddress) {
      rate = rates[fromTokenAddress];
    } else if (fromTokenAddress == internalReserveTokenAddress || 
        fromTokenAddress == externalReserveTokenAddress) {
      rate = rates[toTokenAddress];
    }

    // USDC is the external reserve token and must never run out
    // stable tokens can be bought directly with external reserve token

    if (fromTokenAddress == externalReserveTokenAddress && 
        toTokenAddress == internalReserveTokenAddress
    ) {
      // We're BUYING KUSD with USDC|USDT


      require(
        amount >= minReserveTradeAmount, 
        "Below minimum buying amount"
      );

      // we're using `address(this)` here bcoz the exchange 
      // contract serves as the reserve hence reserve tokens are sent to it
      require(
        externalReserveToken.transferFrom(msg.sender, address(this), amount), 
        "Failed to transfer tokens from user to reserve"
      );

      // IMPORTANT! Internal reserve token must always be 1:1 
      //            pegged with external reserve token

      // IMPORTANT: tradeFee = (amount * 2) / 1000;
      uint256 tradeFee = (amount * tradeFeePercentMultiplier) / tradeFeePercentDivider;
      uint256 mintAmount = amount - tradeFee;
      internalReserveToken.mint(treasury, tradeFee);
      internalReserveToken.mint(msg.sender, mintAmount);


    } else if (fromTokenAddress == internalReserveTokenAddress && 
               toTokenAddress == externalReserveTokenAddress
    ) {
      // We're SELLING KUSD for USDC|USDT


      require(
        amount >= minReserveTradeAmount, 
        "Below minimum selling amount"
      );

      uint256 tradeFee = (amount * tradeFeePercentMultiplier) / tradeFeePercentDivider;
      require(
        internalReserveToken.transferFrom(msg.sender, treasury, tradeFee),
        "Failed to transfer trade fee to treasury"
      );

      uint256 burnAmount = amount - tradeFee;
      internalReserveToken.burnFrom(msg.sender, burnAmount);

      // IMPORTANT! Internal reserve token must always be 1:1 
      //            pegged with external reserve token

      // *********************************************************
      // IMPORTANT: Reserve token actions have been intentionally 
      //            place below burn to prevent re-entrancy from 
      //            reserve token contracts, TRUST NO ONE!!
      // *********************************************************
      // This contract is the RESERVE: no one can ever transfer the reserve tokens
      // IMPORTANT: using require to perform actions
      //            bcoz these methods return boolean
      require(
        externalReserveToken.transfer(msg.sender, burnAmount), 
        "Failed to transfer tokens from reserve to user"
      );


    } else if (stableTokens[fromTokenAddress].minTradeAmount > 0 && 
      (
        toTokenAddress == internalReserveTokenAddress || 
        toTokenAddress == externalReserveTokenAddress
      ) && 
      rate.multiplier > 0 && 
      rate.divider > 0 && 
      rate.lastUpdated > 0 && 
      rate.activated == true
    ) {
      // We're SELLING SIKA for KUSD|USDC|USDT === SIKA/KUSD|USDC|USDT

      require(
        amount >= stableTokens[fromTokenAddress].minTradeAmount, 
        "Below minimum selling amount"
      );

      IBurnableToken stableToken = IBurnableToken(fromTokenAddress);

      uint256 tradeFee = (amount * tradeFeePercentMultiplier) / tradeFeePercentDivider;
      require(
        stableToken.transferFrom(msg.sender, treasury, tradeFee),
        "Failed to transfer trade fee to treasury"
      );

      uint256 burnAmount = amount - tradeFee;
      stableToken.burnFrom(msg.sender, burnAmount);

      // stable to reserve === multiplier / divider === SIKA/KUSD
      uint256 toAmount = (burnAmount * rate.multiplier) / rate.divider;

      // *********************************************************
      // IMPORTANT: Reserve token actions have been intentionally 
      //            place below burn to prevent re-entrancy from 
      //            reserve token contracts, TRUST NO ONE!!
      // *********************************************************
      IERC20 reserveToken = IERC20(toTokenAddress);

      require(
        reserveToken.balanceOf(address(this)) >= toAmount, 
        "Exchange has insufficient reserve token balance"
      );

      // This contract is the RESERVE: no one can ever transfer the reserve tokens
      // In the case of an upgrade; users will need to sell their stable token 
      // and buy the new stable token, all sells must come from the RESERVE
      // IMPORTANT: using require to perform actions bcoz these methods return boolean
      require(
        reserveToken.transfer(msg.sender, toAmount), 
        "Failed to transfer tokens from reserve to user"
      );


    } else if (stableTokens[toTokenAddress].minTradeAmount > 0 && 
      (
        fromTokenAddress == internalReserveTokenAddress || 
        fromTokenAddress == externalReserveTokenAddress
      ) && 
      rate.multiplier > 0 && 
      rate.divider > 0 && 
      rate.lastUpdated > 0 && 
      rate.activated == true
    ) {
      // We're BUYING SIKA with KUSD|USDC|USDT === KUSD|USDC|USDT/SIKA

      IERC20 reserveToken = IERC20(fromTokenAddress);

      // we're using `address(this)` here bcoz the exchange 
      // contract serves as the reserve hence reserve tokens are sent to it
      require(
        reserveToken.transferFrom(msg.sender, address(this), amount), 
        "Failed to transfer tokens from user to reserve"
      );

      // reserve to stable === divider / multiplier === KUSD/SIKA
      uint256 toAmount = (amount * rate.divider) / rate.multiplier;

      require(
        toAmount >= stableTokens[toTokenAddress].minTradeAmount, 
        "Below minimum buying amount"
      );

      // IMPORTANT: tradeFee = (toAmount * 2) / 1000;
      uint256 tradeFee = (toAmount * tradeFeePercentMultiplier) / tradeFeePercentDivider;
      uint256 mintAmount = toAmount - tradeFee;

      IBurnableToken stableToken = IBurnableToken(toTokenAddress);
      stableToken.mint(treasury, tradeFee);
      stableToken.mint(msg.sender, mintAmount);


    } else if (stableTokens[fromTokenAddress].minTradeAmount > 0 && 
               stableTokens[toTokenAddress].minTradeAmount > 0
    ) {
      // if both of the tokens are stable tokens then we're SELLING and BUYING
      // not a direct route: fromToken -> reserveToken -> toToken amount

      // This is a conversion of one stable token to another stable token
      // hence find the rate of each stabletoken with a reserve token
      RateStruct storage fromRate = rates[fromTokenAddress];
      RateStruct storage toRate = rates[toTokenAddress];

      // make sure they're part of our existing exchange pairs
      require(
        fromRate.multiplier > 0 && 
        fromRate.lastUpdated > 0 && 
        fromRate.activated == true && 
        toRate.multiplier > 0 && 
        toRate.lastUpdated > 0 && 
        toRate.activated == true,
        "Non-existent exchange rate"
      );

      // Checked only for fromToken... no need to check for toToken
      require(
        amount >= stableTokens[fromTokenAddress].minTradeAmount, 
        "Below minimum selling amount"
      );

      IBurnableToken fromStableToken = IBurnableToken(fromTokenAddress);

      // IMPORTANT! trade fee will be deducted once, not one for selling and one for buying
      uint256 tradeFee = (amount * tradeFeePercentMultiplier) / tradeFeePercentDivider;
      require(
        fromStableToken.transferFrom(msg.sender, treasury, tradeFee),
        "Failed to transfer trade fee to treasury"
      );

      uint256 burnAmount = amount - tradeFee;

      // burning this amount of fromToken as it 
      // will be minted as a new amount in toToken
      fromStableToken.burnFrom(msg.sender, burnAmount);

      // stable to reserve === multiplier / divider === SIKA/KUSD
      // reserve to stable === divider / multiplier === KUSD/SIKA
      // e.g. KUDI -> KUSD -> SIKA
      uint256 buyAmount =
        (((burnAmount * fromRate.multiplier) / fromRate.divider) * toRate.divider) / toRate.multiplier;

      IBurnableToken toStableToken = IBurnableToken(toTokenAddress);
      toStableToken.mint(msg.sender, buyAmount);

    } else {
      // "Unsupported Direct Exchange. Either these tokens are not supported or you should try converting to a different token first"
      // revert("Unsupported exchange pair. You cannot convert from or to one of these tokens");
      revert("Non-existent exchange rate or no direct conversion");
    }

  }

}
